"use strict";(self.webpackChunkspanish_app=self.webpackChunkspanish_app||[]).push([[279],{9279:e=>{e.exports=JSON.parse('{"12":{"words":[{"spanish":"El cuerpo","english":"The body"},{"spanish":"La salud","english":"The health"},{"spanish":"Estar enfermo(a)","english":"To be sick"},{"spanish":"Me duele...","english":"My... hurts"},{"spanish":"La cabeza","english":"The head"},{"spanish":"El est\xf3mago","english":"The stomach"},{"spanish":"El brazo","english":"The arm"},{"spanish":"La pierna","english":"The leg"},{"spanish":"La mano","english":"The hand"},{"spanish":"El pie","english":"The foot"},{"spanish":"La espalda","english":"The back"},{"spanish":"El cuello","english":"The neck"},{"spanish":"La garganta","english":"The throat"},{"spanish":"Los ojos","english":"The eyes"},{"spanish":"Los o\xeddos","english":"The ears"},{"spanish":"Los dientes","english":"The teeth"},{"spanish":"El dolor","english":"The pain"},{"spanish":"La gripe","english":"The flu"},{"spanish":"La fiebre","english":"The fever"},{"spanish":"El resfriado","english":"The cold"},{"spanish":"La tos","english":"The cough"},{"spanish":"El dolor de garganta","english":"The sore throat"},{"spanish":"La alergia","english":"The allergy"},{"spanish":"El s\xedntoma","english":"The symptom"},{"spanish":"El m\xe9dico","english":"The doctor"},{"spanish":"La enfermera","english":"The nurse"},{"spanish":"El hospital","english":"The hospital"},{"spanish":"La farmacia","english":"The pharmacy"},{"spanish":"La medicina","english":"The medicine"},{"spanish":"La receta","english":"The prescription"},{"spanish":"La cita","english":"The appointment"},{"spanish":"El consultorio","english":"The doctor\'s office"},{"spanish":"Sentirse","english":"To feel"},{"spanish":"Yo me siento","english":"I feel (present)"},{"spanish":"Yo me sent\xed","english":"I felt (past)"},{"spanish":"Estoy bien","english":"I am well"},{"spanish":"Estoy mal","english":"I am unwell"},{"spanish":"Tener dolor de cabeza","english":"To have a headache"},{"spanish":"Yo voy a descansar","english":"I am going to rest"},{"spanish":"Toser","english":"To cough"},{"spanish":"Estornudar","english":"To sneeze"},{"spanish":"Tomar","english":"To take (medicine), to drink"},{"spanish":"Comer sano","english":"To eat healthy"},{"spanish":"Hacer ejercicio","english":"To exercise"},{"spanish":"Cuidar(se)","english":"To take care of oneself"},{"spanish":"Descansar","english":"To rest"},{"spanish":"Cansado(a)","english":"Tired"},{"spanish":"D\xe9bil","english":"Weak"},{"spanish":"Sano(a)","english":"Healthy"}],"conversations":[{"id":1,"topic":"Preguntando c\xf3mo te sientes","dialog":[{"speaker":"Elena","spanish":"Hola, Pedro. \xbfC\xf3mo te sientes hoy?","english":"Hello, Pedro. How do you feel today?"},{"speaker":"Pedro","spanish":"Estoy un poco mal. Me duele la cabeza y tengo fiebre.","english":"I\'m a little unwell. My head hurts and I have a fever."},{"speaker":"Elena","spanish":"Lo siento mucho. \xbfFuiste al m\xe9dico?","english":"I\'m so sorry. Did you go to the doctor?"},{"speaker":"Pedro","spanish":"S\xed, fui ayer. \xc9l me dio medicina. Tengo que tomarla.","english":"Yes, I went yesterday. He gave me medicine. I have to take it."},{"speaker":"Elena","spanish":"Espero que te sientas mejor pronto.","english":"I hope you feel better soon."}],"questions":[{"question":"\xbfC\xf3mo se siente Pedro?","options":["Est\xe1 bien","Est\xe1 contento","Est\xe1 mal","No tiene fiebre"],"answer":"Est\xe1 mal","answerIndex":2},{"question":"\xbfQu\xe9 le duele a Pedro?","options":["El brazo","El est\xf3mago","El pie","La cabeza"],"answer":"La cabeza","answerIndex":3},{"question":"\xbfQu\xe9 tiene que tomar Pedro?","options":["Comida sana","Un caf\xe9","Medicina","Un refresco"],"answer":"Medicina","answerIndex":2}]},{"id":2,"topic":"En la consulta del m\xe9dico","dialog":[{"speaker":"M\xe9dico","spanish":"Buenos d\xedas. \xbfQu\xe9 le duele?","english":"Good morning. What hurts?"},{"speaker":"Paciente","spanish":"Doctor, me duele el est\xf3mago. Me sent\xed mal anoche.","english":"Doctor, my stomach hurts. I felt sick last night."},{"speaker":"M\xe9dico","spanish":"Ya veo. Tambi\xe9n veo que tiene un poco de fiebre.","english":"I see. I also see that you have a little fever."},{"speaker":"Paciente","spanish":"S\xed, y me siento muy cansado.","english":"Yes, and I feel very tired."},{"speaker":"M\xe9dico","spanish":"Tiene que descansar y tomar esta medicina. Vaya a la farmacia.","english":"You have to rest and take this medicine. Go to the pharmacy."}],"questions":[{"question":"\xbfQu\xe9 le duele al paciente?","options":["La pierna","La mano","El est\xf3mago","El brazo"],"answer":"El est\xf3mago","answerIndex":2},{"question":"\xbfCu\xe1ndo se sinti\xf3 mal el paciente?","options":["Esta ma\xf1ana","Anoche","El lunes","El fin de semana"],"answer":"Anoche","answerIndex":1},{"question":"\xbfQu\xe9 tiene que hacer el paciente?","options":["Ir a trabajar","Hacer ejercicio","Descansar y tomar medicina","Ir al hospital"],"answer":"Descansar y tomar medicina","answerIndex":2}]},{"id":3,"topic":"En la farmacia","dialog":[{"speaker":"Farmac\xe9utico","spanish":"Buenas tardes. \xbfC\xf3mo puedo ayudarle?","english":"Good afternoon. How can I help you?"},{"speaker":"Cliente","spanish":"Quiero algo para el dolor de cabeza, por favor.","english":"I want something for a headache, please."},{"speaker":"Farmac\xe9utico","spanish":"Claro. \xbfUsted tiene otros s\xedntomas?","english":"Of course. Do you have other symptoms?"},{"speaker":"Cliente","spanish":"S\xed. Estoy un poco d\xe9bil y me duele la garganta.","english":"Yes. I am a little weak and my throat hurts."},{"speaker":"Farmac\xe9utico","spanish":"Aqu\xed est\xe1 esta medicina. T\xf3mela cada ocho horas.","english":"Here is this medicine. Take it every eight hours."}],"questions":[{"question":"\xbfQu\xe9 quiere el cliente?","options":["Algo para el dolor de cabeza","Algo para el est\xf3mago","Algo para la fiebre","Algo para el brazo"],"answer":"Algo para el dolor de cabeza","answerIndex":0},{"question":"\xbfQu\xe9 otros s\xedntomas tiene el cliente?","options":["Le duele el pie","Se siente d\xe9bil y le duele la garganta","Tiene fiebre","Est\xe1 cansado"],"answer":"Se siente d\xe9bil y le duele la garganta","answerIndex":1},{"question":"\xbfCada cu\xe1nto tiempo debe tomar la medicina?","options":["Cada d\xeda","Cada semana","Cada ocho horas","Cada dos horas"],"answer":"Cada ocho horas","answerIndex":2}]},{"id":4,"topic":"Hablando de h\xe1bitos saludables","dialog":[{"speaker":"Juan","spanish":"Me siento muy bien hoy. Hice ejercicio esta ma\xf1ana.","english":"I feel very well today. I exercised this morning."},{"speaker":"Julia","spanish":"\xa1Qu\xe9 bueno! Yo no hice ejercicio hoy, pero com\xed sano.","english":"How good! I didn\'t exercise today, but I ate healthy."},{"speaker":"Juan","spanish":"Hacer ejercicio y comer sano es muy importante para la salud.","english":"Exercising and eating healthy is very important for health."},{"speaker":"Julia","spanish":"Tienes raz\xf3n. \xbfQu\xe9 comiste hoy?","english":"You are right. What did you eat today?"},{"speaker":"Juan","spanish":"Com\xed una ensalada y pescado. Fue muy delicioso.","english":"I ate a salad and fish. It was very delicious."}],"questions":[{"question":"\xbfQu\xe9 hizo Juan esta ma\xf1ana?","options":["Comi\xf3 sano","Hizo ejercicio","Fue al m\xe9dico","Durmi\xf3"],"answer":"Hizo ejercicio","answerIndex":1},{"question":"\xbfQu\xe9 es importante para la salud, seg\xfan Juan?","options":["Comer mucho","Hacer ejercicio y comer sano","No hacer nada","Dormir todo el d\xeda"],"answer":"Hacer ejercicio y comer sano","answerIndex":1},{"question":"\xbfQu\xe9 significa \'Com\xed una ensalada\'?","options":["I ate a salad","I made a salad","I bought a salad","I am eating a salad"],"answer":"I ate a salad","answerIndex":0}]},{"id":5,"topic":"Una lesi\xf3n","dialog":[{"speaker":"Carlos","spanish":"\xbfQu\xe9 te pas\xf3 en la pierna?","english":"What happened to your leg?"},{"speaker":"Marta","spanish":"Me ca\xed y me duele la pierna mucho.","english":"I fell and my leg hurts a lot."},{"speaker":"Carlos","spanish":"\xa1Ay, qu\xe9 mal! \xbfNecesitas ir al hospital?","english":"Oh no, that\'s bad! Do you need to go to the hospital?"},{"speaker":"Marta","spanish":"No lo s\xe9. La semana pasada tambi\xe9n me ca\xed y me doli\xf3 el brazo.","english":"I don\'t know. Last week I also fell and my arm hurt."},{"speaker":"Carlos","spanish":"Parece que necesitas tener m\xe1s cuidado.","english":"It seems like you need to be more careful."}],"questions":[{"question":"\xbfQu\xe9 le duele a Marta ahora?","options":["El brazo","El pie","La cabeza","La pierna"],"answer":"La pierna","answerIndex":3},{"question":"\xbfQu\xe9 le pas\xf3 a Marta la semana pasada?","options":["Se cay\xf3 y se doli\xf3 el brazo","Fue al hospital","Se cay\xf3 y se doli\xf3 la pierna","Se sinti\xf3 cansada"],"answer":"Se cay\xf3 y se doli\xf3 el brazo","answerIndex":0},{"question":"\xbfQu\xe9 significa \'Necesitas tener m\xe1s cuidado\'?","options":["You need to go to the doctor","You need to rest","You need to be more careful","You need to go to the hospital"],"answer":"You need to be more careful","answerIndex":2}]}],"stories":[{"id":1,"title":"Una Visita al M\xe9dico","sentences":[{"spanish":"Hoy me levant\xe9 y me sent\xed muy mal. Ten\xeda dolor de cabeza y todo el cuerpo me dol\xeda.","english":"Today I woke up and felt very unwell. I had a headache and my whole body hurt."},{"spanish":"Mi esposa me dijo, \'Tienes que ir al m\xe9dico\'. Fui al hospital.","english":"My wife told me, \'You have to go to the doctor\'. I went to the hospital."},{"spanish":"El m\xe9dico me hizo unas preguntas. \'\xbfDesde cu\xe1ndo se siente as\xed?\' me pregunt\xf3.","english":"The doctor asked me some questions. \'Since when have you been feeling this way?\' he asked me."},{"spanish":"Yo le dije que me sent\xed mal desde la ma\xf1ana. \xc9l me diagnostic\xf3 la gripe.","english":"I told him that I felt sick since the morning. He diagnosed me with the flu."},{"spanish":"\xc9l me dio una receta para la medicina. Ahora tengo que ir a la farmacia.","english":"He gave me a prescription for medicine. Now I have to go to the pharmacy."},{"spanish":"Espero que la medicina me ayude a sentirme mejor pronto.","english":"I hope the medicine helps me feel better soon."}]},{"id":2,"title":"El Accidente","sentences":[{"spanish":"Estaba en el parque con mis amigos. Jug\xe1bamos al f\xfatbol y la pas\xe1bamos bien.","english":"I was at the park with my friends. We were playing soccer and having a good time."},{"spanish":"Corr\xed muy r\xe1pido y me ca\xed. Ca\xed en mi brazo y me doli\xf3 mucho.","english":"I ran very fast and I fell. I fell on my arm and it hurt a lot."},{"spanish":"Mis amigos me ayudaron a levantarme. Mi brazo estaba hinchado.","english":"My friends helped me get up. My arm was swollen."},{"spanish":"Fui al hospital. El m\xe9dico me dijo que no era nada grave.","english":"I went to the hospital. The doctor told me it was nothing serious."},{"spanish":"Ahora tengo un yeso en el brazo. No me duele tanto como antes.","english":"Now I have a cast on my arm. It doesn\'t hurt as much as before."},{"spanish":"Tengo que tener cuidado en el futuro cuando juego al f\xfatbol.","english":"I have to be careful in the future when I play soccer."}]},{"id":3,"title":"La Importancia de la Salud","sentences":[{"spanish":"La salud es muy importante. Es necesario cuidar nuestro cuerpo.","english":"Health is very important. It is necessary to take care of our body."},{"spanish":"Yo siempre hago ejercicio y como comida sana. No me siento enfermo casi nunca.","english":"I always exercise and eat healthy food. I almost never feel sick."},{"spanish":"Mi hermano, en cambio, no hace ejercicio y come mucha comida chatarra.","english":"My brother, on the other hand, does not exercise and eats a lot of junk food."},{"spanish":"\xc9l siempre se siente cansado y tiene dolor de est\xf3mago a menudo.","english":"He always feels tired and often has a stomach ache."},{"spanish":"La semana pasada, mi hermano fue al m\xe9dico porque estaba muy d\xe9bil.","english":"Last week, my brother went to the doctor because he was very weak."},{"spanish":"El m\xe9dico le dijo que tiene que cambiar sus h\xe1bitos. La salud es un tesoro.","english":"The doctor told him that he has to change his habits. Health is a treasure."}]}]}}')}}]);